import axios from 'axios';
import React, { useState } from 'react';

const List = () => {
  const[allpost,setallpost]=useState([]);
  axios.get("https://jsonplaceholder.typicode.com/posts").then(res=>{
    setallpost(res.data);
  })
  return
   <div>
    {allpost}</div>;
};

export default List;
